 INSERT INTO `yufu_wx_other` VALUES ('1','CNZZ流量统计','cnzzstatistics',null,'中文互联网站长使用最多的流量统计分析系统，帮助站长实时了解网站被访问情况，进行网站运营分析。\r\nhttp://www.cnzz.com/','1'),('3','51啦流量统计','lastatistics',null,'每天有多少人访问您的网站? 现在有谁正在您的网站上? 他们做了什么?在这里一目了然。http://www.51.la/','1'),('17','多说评论','duoshuo','<!-- Duoshuo Comment BEGIN -->\r\n<div class=\"ds-thread\" data-thread-key=\"{$data.id}\" data-title=\"{$data.title}\"></div>\r\n<script type=\"text/javascript\">\r\nvar duoshuoQuery = {short_name:\"ppaipai\"};\r\n	(function() {\r\n		var ds = document.createElement(\'script\');\r\n		ds.type = \'text/javascript\';ds.async = true;\r\n		ds.src = \'http://static.duoshuo.com/embed.js\';\r\n		ds.charset = \'UTF-8\';\r\n		(document.getElementsByTagName(\'head\')[0] \r\n		|| document.getElementsByTagName(\'body\')[0]).appendChild(ds);\r\n	})();\r\n	</script>\r\n<!-- Duoshuo Comment END -->','让评论更活跃、互动性更强的评论系统，永久免费且容易安装\r\n用微博、QQ、人人、豆瓣等帐号轻松评论和分享\r\n智能识别垃圾评论、稳步提升网站流量\r\nhttp://duoshuo.com/','1'),('4','365webcall在线客服','services',null,'他们从何而来? 搜索引擎为您带来多少点击? 访问者搜索的关键词是什么?','1'),('5','加为收藏','collect','<a href=\"javascript:window.external.AddFavorite(\'http://www.yufu5.com\',\'鱼福网\')\"><img src=\"/yufucms_wx/Apps/Tpl/default/Public/images/jrsc.jpg\"></a>',null,'1'),('6','设为首页','homepage','<a href=\" \" onclick=\"this.style.behavior=\'url(#default#homepage)\';this.setHomePage(\'http://www.yufu5.com\');\"><img src=\"/yufucms_wx/Apps/Tpl/default/Public/images/swsy.jpg\" /></a>',null,'1'),('9','页脚','footer','Copyright © 2013 <a href=\"http://www.yufu5.com\" target=\"_blank\" >www.yufu5.com</a> 鱼福网 版权所有. ',null,'1'),('16','微信审核原则','shenheyz','<p>\r\n含有以下任何内容的，不予审核通过：<br>\r\n1、反对宪法所确定的基本原则的；<br>\r\n2、危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；<br>\r\n3、破坏国家宗教政策，宣扬邪教和封建迷信的；<br>\r\n4、散布谣言，扰乱社会秩序，破坏社会稳定的；<br>\r\n5、散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；<br>\r\n6、侮辱或者诽谤他人，侵害他人合法权益的；<br>\r\n7、含有法律、行政法规禁止的其他内容的信息<br>\r\n</p>',null,'1'),('11','百度分享','bdshare','<!-- Baidu Button BEGIN -->\r\n<script type=\"text/javascript\" id=\"bdshare_js\" data=\"type=slide&amp;img=2&amp;pos=left&amp;uid=6598355\" ></script>\r\n<script type=\"text/javascript\" id=\"bdshell_js\"></script>\r\n<script type=\"text/javascript\">\r\ndocument.getElementById(\"bdshell_js\").src = \"http://bdimg.share.baidu.com/static/js/shell_v2.js?cdnversion=\" + Math.ceil(new Date()/3600000);\r\n</script>\r\n<!-- Baidu Button END -->',null,'1'),('13','android微信客户端下载','androidweixin','http://weixin.qq.com/cgi-bin/readtemplate?uin=&stype=&promote=&fr=&lang=zh_CN&ADTAG=&check=false&nav=download&t=weixin_download_list&loc=readtemplate,weixin,body,3',null,'1'),('14','iphone微信客户端下载','iphoneweixin','http://weixin.qq.com/cgi-bin/readtemplate?uin=&stype=&promote=&fr=&lang=zh_CN&ADTAG=&check=false&nav=download&t=weixin_download_list&loc=readtemplate,weixin,body,3',null,'1'),('15','qq群','qqqun','QQ群：322749653',null,'1');/* MySQLReback Separation */
